import React, { useState } from "react";
import "./header.css";

export default function Header() {
    /*=============== Header shadow when scroll down===============*/
      window.addEventListener("scroll", function () {
        const header = document.querySelector(".header");
        if (this.scrollY >=80) header.classList.add("scroll-header");
        else header.classList.remove("scroll-header");
      });
    /*=============== Toggle Menu ===============*/
    const[Toggle,showMenu] = useState(false);
    const [activeNav, setActiveNav] = useState("#home");
  return (
    <header className="header">
      <nav className="nav container">
        <a href="index.html" className="nav__logo">
          Chloe Phan
        </a>

        <div className = {Toggle ? "nav_menu show-menu" : "nav_menu"}>
          <ul className="nav__list grid">
            <li className="nav__item">
              <a href="#home"
                 onClick= {() => setActiveNav("#home")}
                 className = {activeNav === "#home" ? "nav__link active-link" : "nav__link"}>
                <i className="uil uil-estate nav__icon"></i> Home
              </a>
            </li>
            <li className="nav__item">
              <a href="#about"
                 onClick= {() => setActiveNav("#about")}
                 className = {activeNav === "#about" ? "nav__link active-link" : "nav__link"}>
                <i className="uil uil-user nav__icon"></i> About
              </a>
            </li>
            <li className="nav__item">
              <a href="#skills"
                 onClick= {() => setActiveNav("#skills")}
                 className = {activeNav === "#skills" ? "nav__link active-link" : "nav__link"}>
                <i className="uil uil-file-alt nav__icon"></i> Skills
              </a>
            </li>

            <li className="nav__item">
              <a href="#experience"
                 onClick= {() => setActiveNav("#experience")}
                 className = {activeNav === "#experience" ? "nav__link active-link" : "nav__link"}>
                <i className="uil uil-user nav__icon"></i> Experience
              </a>
            </li>
            <li className="nav__item">
              <a href="#projects"
                 onClick= {() => setActiveNav("#projects")}
                 className = {activeNav === "#projects" ? "nav__link active-link" : "nav__link"}>
                <i className="uil uil-user nav__icon"></i> Projects
              </a>
            </li>

            <li className="nav__item">
                <a href="#qualification"
                     onClick= {() => setActiveNav("#qualification")}
                     className = {activeNav === "#qualification" ? "nav__link active-link" : "nav__link"}>
                    <i className="uil uil-user nav__icon"></i> Qualification
                </a>
            </li>

            <li className="nav__item">
                <a href="#contact"
                     onClick= {() => setActiveNav("#contact")}
                     className = {activeNav === "#contact" ? "nav__link active-link" : "nav__link"}>
                    <i className="uil uil-message nav__icon"></i> Contact
                </a>
            </li>
          </ul>
          <i className="uil uil-times nav__close" onClick = {() => showMenu(!Toggle)}></i>
        </div>

        <div className ="nav_toggle" onClick = {() => showMenu(!Toggle)}>
          <i className="uil uil-apps"></i>
        </div>
      </nav>
    </header>
  );
};
